import { 
  BrowserRouter as Router, 
  Route, 
  Switch, 
  Link, 
  Redirect 
} from "react-router-dom"

function App() {
  return (
    <Router>
      <Switch>

        {/* main pages */}
        <Route exact path="/">
          <Projects />
        </Route>

        <Route exact path="/experience">
          <Experience />
        </Route>

        <Route exact path="/about">
          <About />
        </Route>

        {/* project pages */}
        <Route exact path="/pilly">
          <Pilly />
        </Route>
        <Route exact path="/steghide">
          <StegHide />
        </Route>
        <Route exact path="/ecoblock">
          <EcoBlock />
        </Route>
        <Route exact path="/botanist">
          <Botanist />
        </Route>
        <Route exact path="/vibecheck">
          <VibeCheck />
        </Route>
        {/* <Route exact path="/certichain">
          <CertiChain />
        </Route> */}
        {/* <Route exact path="/vaccurate">
          <Vaccurate />
        </Route> */}
        {/* <Route exact path="/planty">
          <Planty />
        </Route> */}
        {/* <Route exact path="/farmily">
          <Farmily />
        </Route> */}
        {/* <Route exact path="/thiswebsite">
          <ThisWebsite />
        </Route> */}
        {/* <Route exact path="/dormbuddy">
          <DormBuddy />
        </Route> */}
      </Switch>
    </Router>
  );
}

export default App;
